description:
 Philip Carter, &quot;IQ and Psychometric Tests: Assess Your Personality, Aptitude and Intelligence, 2 Edition&quot;
2008 | ISBN: 0749451068 | 236 pages | PDF | 3,4 MB

IQ and psychometric tests are increasingly used in recruitment and selection procedures by companies who want to ensure they employ workers of the highest caliber. With hundreds of questions on verbal, numerical and spatial ability, memory, creativity, and personality, IQ and Psychometric Tests will help job candidates weight their strengths and weaknesses and improve their scores. It also includes two completely new, full length IQ tests. Not just a preparation book, IQ and Psychometric Tests will also appeal to anyone who enjoys stretching their mind and exercising their brain.
